import React from "react";
import { motion } from "framer-motion";
import exImage from "./html.png";

const Xp = () => {
  return (
    <div className="fond">
      <motion.div
        initial={{ y: "10vh" }}
        animate={{ y: 0 }}
        transition={{ duration: 1, type: "spring", stiffness: 100 }}
      >
        <div className="xp_card">
          <div className="xp_image">
            <img
              src={exImage}
              alt="Avatar"
              style={{ width: "40vw", height: "40vh" }}
            />
          </div>
          <div className="xp_text_card">
            <text className="xp_title">Virbac internship</text>
            <text className="xp_description">Internship at onClick={()=>setPage(1)}irbac's IT department. {'\n'}
                                            I had the chance to put my skills into practive, and designed python classification algorithms for production batch data.</text>
          </div>
        </div>
      </motion.div>

      <motion.div
        initial={{ y: "10vh" }}
        animate={{ y: 0 }}
        transition={{ duration: 1, type: "spring", stiffness: 100 }}
      >
        <div className="xp_card">
          <div className="xp_image">
            <img
              src={exImage}
              alt="Avatar"
              style={{ width: "40vw", height: "40vh" }}
            />
          </div>
          <div className="xp_text_card">
            <text className="xp_title">Experience 1</text>
            <text className="xp_description">description...</text>
          </div>
        </div>
      </motion.div>

      <motion.div
        initial={{ y: "10vh" }}
        animate={{ y: 0 }}
        transition={{ duration: 1, type: "spring", stiffness: 100 }}
      >
        <div className="xp_card">
          <div className="xp_image">
            <img
              src={exImage}
              alt="Avatar"
              style={{ width: "40vw", height: "40vh" }}
            />
          </div>
          <div className="xp_text_card">
            <text className="xp_title">Experience 1</text>
            <text className="xp_description">description...</text>
          </div>
        </div>
      </motion.div>
    </div>
  );
};

export default Xp;
